import Home from './componentes/Home'
import './App.css';
import {BrowserRouter as Router,Switch,Route,Link}from 'react-router-dom'




function App() {
  return (
   <Switch>
    <Route path='/'>
       <Home />
    </Route>
    <Route path='/:id'>
       <h1>tipos id</h1>
    </Route>
    <Route path='/types'>
    <h1>pokemon tipos</h1>
    </Route>
    <Route path='/createpokemon'>
       <h1>pokemon creando</h1>
    </Route>
   </Switch>
  );
}


export default App;
